// List.jsx
import React, { useState } from 'react';
import styles from '../../css/Boardlist.module.css'; // CSS 모듈 가져오기

const Boardlist = () => {
  const [posts, setPosts] = useState([
    { id: 1, title: 'Example Title 1', content: 'This is the content for post 1.' },
    { id: 2, title: 'Example Title 2', content: 'This is the content for post 2.' },
  ]);

  return (
    <div className={styles.container}>
      <h3 className={styles.title}>글 목록</h3>
      <ul className={styles.list}>
        {posts.map(post => (
          <li key={post.id} className={styles.listItem}>
            <h4 className={styles.postTitle}>{post.title}</h4>
            <p className={styles.postContent}>{post.content}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Boardlist;
